<!DOCTYPE html><html lang=""><head><meta charset="utf-8"><meta http-equiv="X-UA-Compatible" content="IE=edge"><meta name="viewport" content="width=device-width,initial-scale=1"><script>// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string,
      // converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function (l) {
        if (l.search[1] === "/") {
          var decoded = l.search
            .slice(1)
            .split("&")
            .map(function (s) {
              return s.replace(/~and~/g, "&");
            })
            .join("?");
          window.history.replaceState(
            null,
            null,
            l.pathname.slice(0, -1) + decoded + l.hash
          );
        }
      })(window.location);</script><link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.13.1/css/all.css" integrity="sha384-xxzQGERXS00kBmZW/6qxqJPyxW3UR0BPsL4c8ILaIWXva5kFi7TxkIIaMiKtqV1Q" crossorigin="anonymous"><link rel="icon" href="/favicon.ico"><title>pratice-interactive</title><link href="/css/best-main.f4f3b5c8.css" rel="prefetch"><link href="/js/best-main.6a4da3b8.js" rel="prefetch"><link href="/js/webtoon.d6b28f4b.js" rel="prefetch"><link href="/css/app.b10a0bc9.css" rel="preload" as="style"><link href="/js/app.395e209b.js" rel="preload" as="script"><link href="/js/chunk-vendors.1fc5ee3d.js" rel="preload" as="script"><link href="/css/app.b10a0bc9.css" rel="stylesheet"></head><body><noscript><strong>We're sorry but pratice-interactive doesn't work properly without JavaScript enabled. Please enable it to continue.</strong></noscript><div id="app"></div><script src="/js/chunk-vendors.1fc5ee3d.js"></script><script src="/js/app.395e209b.js"></script></body></html>
